@import 'variable';
@import 'mixins';
@import 'tien.scss';
.table-ranking-teacher {
    table.table.ranking {
        border-collapse: collapse;
    }

    .tb-nav .tb-nav-wrap {
        display: flex;
        justify-content: space-between;
        margin: 15px -10px;
    }

    .tb-nav .tb-nav-wrap .nav-item {
        padding: 10px 15px;
        width: calc((100%/4) - 15px);
        margin: 0 10px;
        font-size: 24px;
        text-align: center;
        text-decoration: none;
        color: #fff;
    }

    .tb-nav .tb-nav-wrap .nav-item.week {
        background: #f57893;
    }

    .tb-nav .tb-nav-wrap .nav-item.month {
        background: #ffe395;
    }

    .tb-nav .tb-nav-wrap .nav-item.quy {
        background: #29ceff;
    }

    .tb-nav .tb-nav-wrap .nav-item.year {
        background: #4aad64;
    }

    .table.ranking tr td,
    .table.ranking tr,
    .table.ranking th {
        border-bottom: 1px solid #e1e1e1;
        vertical-align: middle;
        position: relative;
        text-align: center;
    }

    .table.ranking tr th:first-child {
        padding-left: 15px;
        text-align: left;
    }

    .table.ranking tr td:first-child {
        width: 50px;
    }

    .table.ranking tr td.rank {
        position: relative;
        padding-left: 30px;
        padding-right: 30px;
    }

    .table.ranking .icon-rank {
        width: 30px;
        height: 30px;
        border-radius: 50%;
        display: block;
        border: 2px solid rgba(0, 0, 0, 0.2);
        position: relative;
    }

    .table.ranking .icon-rank.first {
        border-color: #ffe395;
    }

    .table.ranking .icon-rank.first:after {
        background: #ffe395;
    }

    .table.ranking .icon-rank.second {
        border-color: #29ceff;
    }

    .table.ranking .icon-rank.second:after {
        background: #29ceff;
    }

    .table.ranking .icon-rank.third {
        border-color: #f57893;
    }

    .table.ranking .icon-rank.third:after {
        background: #f57893;
    }

    .table.ranking .icon-rank:after {
        content: '';
        width: 25px;
        height: 25px;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        background: rgba(0, 0, 0, 0.2);
        border-radius: 50%;
    }

    .table.ranking .rank-change {
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
    }

    .table.ranking .rank-change.up {
        width: 0;
        height: 0;
        border-style: solid;
        border-width: 0 15px 15px 15px;
        border-color: transparent transparent #19e326 transparent;
    }

    .table.ranking .rank-change.down {
        width: 0;
        height: 0;
        border-left: 15px solid transparent;
        border-right: 15px solid transparent;
        border-top: 15px solid #f00;
    }

    .table.ranking {
        th {
            background: #F5F6FA;
            z-index: 2;
            color: #001737;
        }
    }
}

