.detail-fixed {
    &.show {
        -webkit-transform: none;
        transform: none;
        opacity: 1;
        padding: 0;

        .bg-overlay {
            -webkit-transform: none;
            transform: none;
        }
    }

    .bg-overlay {
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        z-index: 1;
        background: rgba(0, 0, 0, 0.6);
        -webkit-transition: all 0.3s ease-in-out;
        -moz-transition: all 0.3s ease-in-out;
        -o-transition: all 0.3s ease-in-out;
        -ms-transition: all 0.3s ease-in-out;
        transition: all 0.3s ease-in-out;
        -webkit-transform: translateX(9999px);
        transform: translateX(9999px);
    }

    .content-detail-wrapper {
        z-index: 4;
        position: relative;
        background: #fff;
    }

    position: fixed;
    right: 0 !important;
    bottom: 0;
    opacity:0;
    z-index: 3;
    top: 60px;
    overflow-y: auto;
    -webkit-transform: translateX(100%);
    transform: translateX(100%);
    -webkit-transition: all 0.3s ease-in-out;
    -moz-transition: all 0.3s ease-in-out;
    -o-transition: all 0.3s ease-in-out;
    -ms-transition: all 0.3s ease-in-out;
    transition: all 0.3s ease-in-out;
    float: none;
    background: #fff;

    &.no-fixheight {
        overflow-y: visible;
        max-height: 100%;
    }

    &.datepicker-modal {
        max-height: none;
    }

    .modal-footer {
        height: auto;
        padding-bottom: 15px;
        padding-top: 15px;
        border-top: 1px solid #e1e1e1;
        justify-content: flex-start;
    }

    .modal-content {
        padding: 15px;

        &:before,
        &:after {
            display: table;
            content: "";
            clear: both;
        }
    }
}

