            }

            &:after {
                content: "\f00c";
                font-family: 'Font Awesome 5 Free';
                font-weight: 900;
                text-rendering: auto;
                -webkit-font-smoothing: antialiased;
                -moz-osx-font-smoothing: grayscale;
                position: absolute;
                left: 5px;
                top: 0;
                color: $primary-color;
                opacity: 0;
                @include transition(.2s);
