.tb-checkmark {
    display: block;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    text-align: center;
    margin-bottom: 0;

    &:hover {
        span::after {
            display: block;
            opacity: 0.3;
        }

        input {
            &:checked+span {
                &:after {
                    opacity: 1;
                }
            }
        }
    }

    input {
        display: none;

        &:checked+span {
            &:after {
                display: block;
                opacity: 1;
            }
