            justify-content: center;
            width: 170px;
            flex-shrink: 0;
            background: #061737;

            &-name {
                margin-bottom: 0;
                font-size: 18px;
                color: #fff;
                text-align: center;
                text-transform: uppercase;
            }

            &-quantity {
                color: #fddd64;
                margin-bottom: 0;
                font-weight: 500;
                font-size: 14px;
                margin-bottom: 5px;
            }

            &-price {
                color: $money-color;
                font-weight: 600;
                font-size: 20px;
                margin-bottom: 0;
            }
        }

        .item__list {
            padding: 15px 5px;
            display: flex;
            overflow: auto;
            position: relative;

            .test__kit__wrap {
                padding: 0 10px;
                flex: 1;
                min-width: 250px;

                &.test__kit__empty {
                    white-space: nowrap;
                    padding: 30px 10px;
                    flex-shrink: 0;

                    .add-set {
                        font-size: 26px;
                        color: #ccc;
                        display: flex;
                        flex-grow: 1;
                        align-items: center;
                        justify-content: center;
                    }

                    .test__kit__action {
                        flex-grow: 1;
                    }
                }
            }

            .test__kit {
                height: 100%;
                box-shadow: 0px 0px 6px 0px rgba(255, 255, 255, 0.3);
                border-radius: 4px;
                display: flex;
                flex-direction: column;
                justify-content: center;
                background: #fff;
                @include transition(.3s);
                justify-content: space-between;

                &:hover {
                    transform: translateY(-5px);
                    background: #fff;
                    box-shadow: 4px 4px 8px 0px rgba(255, 255, 255, 0.5);
                }

                &__type {
                    width: 100%;
                    display: block;
                    text-align: center;
                    padding: 10px;
                    border-bottom: 1px solid #e1e1e1;

                    &-name {
                        display: block;
                        color: #ccc;
                        text-transform: uppercase;
                        font-weight: 500;
                        font-size: 11px;
                    }
                }

                &__action {
                    display: flex;
                    padding: 10px;
                    justify-content: center;

                    .btn-action {
                        display: inline-block;
                        flex: 1;
                        text-align: center;
                        padding: 5px 10px;
                        background: #fff;
                        white-space: nowrap;
                        border: 1px solid $primary-color;
                        color: $primary-color;
                        ;
                        border-radius: 0px;
                        margin-right: 10px;

                        &:last-child {
                            margin-right: 0;
                        }

                        @include transition(.2s);

                        &:hover {
                            background: $primary-color;
                            color: #fff;
                        }

                        &.btn-info {
                            color: #fff;
                            background-color: #00b8d4;
                            border-color: #00b8d4;
                        }

                        &.btn-do-test {
                            background: #ffc107;
                            color: #000;
                            border-color: #ffc107;
                        }
                    }
                }

                .test__kit__info {
                    text-align: center;
                    padding: 10px;
                    flex-grow: 1;

                    &-name {
                        font-size: 16px;
                        text-align: center;
                        line-height: 1.3;
                        margin-bottom: 10px;
                        flex-grow: 1;
                        display: flex;
                        align-items: center;
                        color: #252525;
                        font-weight: 600;
                    }

                    &-set {
                        padding: 5px;
                        border: 1px solid #e1e1e1;
                        text-align: left;

                        .set__group {
                            margin-bottom: 0;

                            .set__type {
                                display: flex;
                                justify-content: space-between;
                            }
                        }
                    }

                    &-status {
                        margin-bottom: 0;
                    }

                    &-grade {
                        margin-bottom: 15px;
                    }
                }
            }
        }
    }
