.select-word {
    height: 100%;
}

.dropzone {
    display: inline-block;
    min-width: 100px;
    background: #ebebeb;
    min-height: 31px;
    text-align: center;
    padding: 5px;
    vertical-align: text-bottom;
    cursor: pointer;
    margin: 5px;

    &.wrong-question {
        background: #ffc2c2 !important;
    }
}

.type-answer {
    @extend .dropzone;
    min-height: auto;
    padding: 3px 5px;
    vertical-align: initial;
}

.choose-answer {
    display: flex;
    align-items: center;
    padding: 15px 0;
    margin-bottom: 15px;
    flex-wrap: wrap;

    &.draggable-dropzone--active {
        background: #fdfbe4;
        border: 1px dashed #ccc;
    }
}

.question__wrap {
    &.active {
        outline: 2px solid $primary-color;
    }
}

.drop-answer {
    .dropwrap {
        display: inline-block;
        min-width: 100px;
        background: #ebebeb;
        min-height: 31px;
        text-align: center;
        padding: 0;
        vertical-align: text-bottom;
        cursor: pointer;

        .dropzone {
            margin-bottom: 0;
            display: block;
            //  background: none;
        }

        &.draggable-dropzone--occupied {
            background: none;
            padding: 0;
            margin: 0;

            // min-height: auto;
            // vertical-align: middle;
            .dropzone {
                margin: 0;
            }
        }
    }

    .draggable-dropzone--occupied {
        background: #ccd5f1;
        min-height: auto;
    }

    .draggable-dropzone--active {
        background: #f9f8bd;
        border: 1px dashed #000;
        box-shadow: 0px 0px 4px 0px rgba(0, 0, 0, .14);
        width: 100px;
        white-space: nowrap;
        text-overflow: ellipsis;
        overflow: hidden;
    }

    .draggable-mirror {
        width: 100px;
        white-space: nowrap;
        text-overflow: ellipsis;
        overflow: hidden;
    }

    .draggable-source--is-dragging+.draggable--original {
        display: none !important;
    }

    .draggable--original {
        display: inherit !important;

        &+.draggable-source--is-dragging {
            display: none;
        }

    }
}

.dropwrap {
    .draggable-dropzone--active {
        border: 1px dashed #000;
        box-shadow: 0px 0px 4px 0px rgba(0, 0, 0, .14);
    }
}

.drop-container {
    outline: 0;

    * {
        outline: 0;
    }
}

.drop-container {
    outline: 0;

    >* {
        outline: 0;
    }

    outline: 0;
}

.rating-star {
    position: relative;
}

.set-img {
    position: relative;

    .badge-wrap {
        position: absolute;
        left: 0;
        top: 15px;
    }

    $trust-badge-premium: #ed4a68;
    $trust-badge-free: #2A3E87;

    .trust-badge {
        display: inline-block;
        position: relative;
        padding: 0 5px 0 10px;
        margin: 0 0 5px 0;
        font-weight: 300;
        -webkit-border-radius: 0;
        -moz-border-radius: 0;
        border-radius: 0;
        height: 30px;
        line-height: 30px;
        color: white;
        white-space: nowrap;
        vertical-align: middle;
        font-size: 9px;
        font-weight: 600;
    }

    .trust-badge-top {
        position: absolute;
        top: 0;
        right: -30px;
        width: 0;
        height: 0;
        border-style: solid;
        border-width: 30px 30px 0 0;
    }

    .trust-badge-bottom {
        position: absolute;
        top: 0;
        right: -30px;
        width: 0;
        height: 0;
        border-style: solid;
        border-width: 30px 0 0 30px;
    }

    .trust-badge a {
        display: block;
        color: white;
        text-decoration: none;
        font-size: 18px;

        &:hover {
            color: white;
        }
    }

    .trust-badge-premium {
        background: linear-gradient(89.67751308924721deg, rgba(237, 0, 67, 1) 19.08072916666667%, rgba(242, 71, 103, 1) 74.6015625%, rgba(243, 72, 104, 1) 74.6015625%);

        .trust-badge-top {
            border-color: $trust-badge-premium transparent transparent transparent;
        }

        .trust-badge-bottom {
            border-color: transparent transparent transparent $trust-badge-premium;
        }
    }

    .trust-badge-free {
        background: $trust-badge-free;

        .trust-badge-top {
            border-color: $trust-badge-free transparent transparent transparent;
        }

        .trust-badge-bottom {
            border-color: transparent transparent transparent $trust-badge-free;
        }
    }
}

.my-package {
    .set-img .trust-badge {
        line-height: 25px;
        height: 25px;

        .trust-badge-top {
            right: -25px;
            border-width: 25px 25px 0 0;
        }

        .trust-badge-bottom {
            right: -25px;
            border-width: 25px 0 0 25px;
        }
    }
}

.tx-center-last {
    text-align-last: center;
}

.box__select {
    display: block;

    input[type="checkbox"] {
        display: none;

        &:checked {
            &+.set__pack {
                background: rgba(52, 98, 200, 0.17);
                box-shadow: 0px 0px 6px 0px rgba(52, 98, 200, 0.1);

                .option-icon {
                    color: rgba(52, 98, 200, 0.56);
                }

                .option-name {
                    color: rgba(52, 98, 200, 0.86);
                }
            }
        }
    }

    .set__pack {
        display: flex;
        justify-content: center;
        align-items: center;
        padding: 30px;
        border: 1px solid transparent;
        border-radius: 8px;
        box-shadow: 0px 0px 6px 0px rgba(0, 0, 0, .14);
        @include transition(.2s);
    }

    .option-icon {
        font-size: 60px;
        color: #c7c7c7;
        @include transition(.2s);
    }

    .option-name {
        font-size: 24px;
        vertical-align: middle;
        margin-left: 15px;
        font-weight: bold;
        color: #a2a2a2;
        @include transition(.2s);
    }
}

.thumbnail-preview {
    cursor: pointer;

    &:hover {
        &:after {
            z-index: 1;
        }

        .fa-upload {
            z-index: 2;
        }
    }

    &:after {
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: rgba(255, 255, 255, .6);
        content: '';
    }

    .fa-upload {
        font-size: 120px;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
        z-index: 0;
        color: rgba(52, 97, 200, 0.35);
    }

    img {
        z-index: 1;
        position: relative;
        object-fit: cover;
    }
}

.object-fit {
    object-fit: cover;
}

.tb-set-manager {
