        opacity: 0.5;
    }
}

.preview-audio {
    display: flex;
}

.setting-audio {
    .custom-file-label {
        text-overflow: ellipsis;
        overflow: hidden;
        white-space: nowrap;
        padding-right: 75px;
        display: block;
    }
}

.table-group-question {
    thead tr th {

        &.th-name,
        &.th-title,
        &.th-description {
            min-width: 150px;
        }
    }
}

.off-canvas {
    &.question-canvas {
        width: 100%;
        max-width: 768px;
    }
}

.line-clamp {
    display: -webkit-box;
    -webkit-line-clamp: 3;
    -webkit-box-orient: vertical;
    overflow: hidden;

    &.clamp-2 {
        -webkit-line-clamp: 2;
    }
}

body.drop-answer {
    background: #fff;

    .dropwrap {
        vertical-align: middle;
        margin: 0 5px;
    }
}

.noise-word,
.correct-answer {
    display: flex;
    align-items: center;

    .action-icon {
        white-space: nowrap;
        margin-left: 10px;

        svg {
            width: 20px;
            height: 20px;
        }
    }
}

.noise-word {
    .highlight-box {
        background: rgba(253, 246, 246, 0.98);
        box-shadow: 0px 0px 0px 1px #ff7070;

        &:focus,
        &:hover {
            background: rgba(253, 246, 246, 0.98);
            box-shadow: 0px 0px 0px 1px #ff7070;
        }
    }
}

.highlight-box {
    background: rgba(241, 245, 255, 0.98);
    box-shadow: 0px 0px 0px 1px #3462C8;

    &:focus,
    &:hover {
        background: rgba(241, 245, 255, 0.98);
        box-shadow: 0px 0px 0px 1px #3462C8;
    }
}

.draggable--over {
    &.draggable-dropzone--wrong {
        outline: 5px solid red;

        &.draggable-dropzone--occupie {
            box-shadow: 4px 4px 8px 0px red;
        }
    }
}

.dropwrap {
    &.draggable-dropzone--wrong {
        background: #f9e5e5;
    }
}

.context-menu {
    width: 125px;
    z-index: 1;
    box-shadow: 0 4px 5px 3px rgba(0, 0, 0, 0.2);
    background: #fff;
    position: fixed;
    display: none;
    transition: 0.2s display ease-in;

    .menu-options {
        list-style: none;
        padding: 0;
        z-index: 1;
        margin-bottom: 0;
        user-select: none;

        .menu-option {
            font-weight: 500;
            font-size: 14px;
            z-index: 1;
            padding: 15px 10px;
            cursor: pointer;

            &:hover {
                background: $primary-color;
                color: #fff;

                svg {
                    color: #fff;

                }
            }

            svg {
                color: $primary-color;
                margin-right: 5px;
            }
        }
    }
}

.highlight-word {
    background: #5c8df9;
    color: #fff;
    padding: 0 5px;

    &.has-note {
        cursor: pointer;
        background: $primary-color;

        &:after {
            content: '\f15c';
            font-family: 'Font Awesome 5 Free';
            font-weight: 400;
            color: white;
            margin-left: 5px;

        }
    }

    .dropwrap {
        color: #001737;
    }
}

.note-popup {
    width: 250px;

    .header-popup {
        position: relative;
    }

    .edit-note {
        position: absolute;
        right: 10px;
        font-size: 20px;
        top: 50%;
        transform: translateY(-50%);
        cursor: pointer;
    }

    .popover-header {
        padding-right: 45px;
    }

    .popover-body {
        background: beige;
        outline: 0;
        min-height: 100px;
    }
}

.time-remain {
    cursor: pointer;
    font-size: 20px;
    color: $primary-color;

    .hour {
        display: none;
    }

    .minute,
    .hour {
        display: none;

        &:after {
            content: ':';
            margin: 0 1px;
            display: none;
        }
    }

    .second {
        display: none;
    }

    &:after {
        content: ' minutes left';
        margin-left: 5px;
    }

    &:after {
        content: 'Click to show time'
    }

    &:hover {
        .minute {
            display: initial;
        }

        &:after {
            content: ' minutes left'
        }
    }
}

#js-toggleTime:checked+.time-remain {
    .hour {
        display: none;

        &:after {
            display: none;
        }
    }

    .minute {
        display: initial;

        &:after {
            display: initial;
        }
    }

    .second {
        display: initial;

    }

    &:after {
        content: ' left';
    }
}

.bottom-header {
    background-color: darken($primary-color, 5%);

    width: 100%;
    z-index: 999;

    >.container {
        padding: 0;
        max-width: 1170px !important;
        padding: 0 15px;
    }

    @media (min-width:992px) {
        position: fixed;
        top: 55px;

    }

    .hd-menu-list {
        display: flex;
        align-items: center;
        padding: 0;
        margin: 0;
        overflow: auto;
        @include scrollbars(4px, $border-color);
        transition: transform .2s cubic-bezier(0.52, 0.57, 0.69, 0.67);

        &+.menu-overlay {
            content: '';
            position: fixed;
            width: 100%;
            height: 100%;
            top: 0;
            left: 0;
            z-index: 998;
            background: rgba(0, 0, 0, .6);
            transform: translateX(-200%);
            transition: transform .2s cubic-bezier(0.52, 0.57, 0.69, 0.67);
        }

        .menu-link {
            display: inline-block;
            white-space: nowrap;

            >a {
                position: relative;

                &:after {
                    content: '';
                    width: 0;
                    height: 0;
                    border-bottom: 2px solid #fff;
                    position: absolute;
                    left: 0;
                    bottom: 2px;
                    opacity: 0;
                    @include transition(.2s);
                }
                &.active,
                &:hover {
                    &:after {
                        width: 100%;
                        opacity: 1;
                    }
                }

                padding: 15px 15px;
                color: #fff;
                display:block;
            }
        }
    }





    .burger-menu-bottom {
        display: none;
        @include transition(.3s);
        &.active {
            z-index: 9999;
            position: fixed;
            top: 10px;
            left: 250px;
            &~.hd-menu-list,
            &~.menu-overlay {
                transform: none;
            }
        }
    }
}

