.fb-summary-container {
    background: #fff;
    padding: 15px 30px;
    margin-bottom: 30px;
    box-shadow:0 2px 8px 0 rgba(0,0,0,.15);
    border-radius: 8px;
}

.fb-summary {
    display: flex;
    align-items: center;
    flex-wrap: wrap;
    justify-content: space-between;
    padding-top: 10px;
    border-top: 1px solid #e1e1e1;

    .fb-type {
        padding: 5px 10px;
    }

}

.fb-radio {
    label {
        margin-bottom: 0;
    }

    input {
        visibility: hidden;
        height: 0;
        width: 0;
        opacity: 0;
        user-select: none;
        cursor: none;

        &+span {
            position: relative;
            padding-left: 30px;

            &:before {
                content: '';
                position: absolute;
                top: 0;
                left: 0;
                width: 20px;
                height: 20px;
                border-radius: 15px;
                border: 2px solid $primary-color;
            }

            &:after {
                content: '';
                position: absolute;
                top: 5px;
                left: 5px;
                width: 10px;
                height: 10px;
                border-radius: 8px;
                background-color: transparent;
            }
        }

        &:checked+span {
            &:after {
                background-color: $primary-color;
            }
        }
    }

    .number {
        margin-left: 10px;
        color: $second-color;
        font-weight: 'bold';
        font-style: 'italic'
    }
}
.rating-wrap {
    flex-shrink: 0;
    display: flex;
    align-items: center;
    font-size: 18px;

    i {
        color: $primary-color;
        margin: 0 2px;
    }
}
.fb-item {
    display: flex;
    align-items: flex-start;
    padding: 30px;
    background: #fff;
    margin-bottom: 30px;
    box-shadow:0 2px 8px 0 rgba(0,0,0,.15);
    border-radius: 8px;

    .fb-avatar {
        .avatar {
            width: 100px;
            height: 100px;
            object-fit: cover;
            border-radius: 50px;

            @include media(768px) {
                width: 50px;
                height: 50px;
            }
        }
    }

    .fb-info {
        flex-grow: 1;
        margin-left: 30px;

        .name-rating {
            display: flex;
            justify-content: space-between;
            margin-bottom: 10px;

            .name {
                flex-grow: 1;
                margin-bottom: 0;
                font-size: 1.15rem;
                font-weight: 600
            }


        }

        .feedback-comment {
            margin-bottom: 5px;

            p {
                margin-bottom: 0px;
            }
        }

        .actions {

            margin-top: 5px;
        }
    }

}

.metas {
    display: flex;
    margin: 0 -10px;
    flex-wrap: wrap;
    margin-bottom: 5px;

    .meta {
        font-size: 13px;
        color: #b1b1b1;

        span {
            font-weight: 500;
            color: $primary-txt-color
        }

        padding:5px 10px;
    }
}

.tc-comment-wrap {
    padding-top: 15px;
    border-top: 1px solid #e1e1e1;
    margin-top: 15px;

    &.hidden {
        display: none;
    }

    .tc-comment {
        display: flex;
        +.tc-comment{
            margin-top:15px;
        }
        .tc-content {
            margin-left: 10px;
            padding: 10px;
            border-radius: 8px;
            border: 1px solid $primary-color;
            position: relative;
        }

        .teacher-name {
            color: $second-color;
            margin-bottom: 5px;
            font-weight: 600;
        }

        .meta {
            color: #b1b1b1;
        }

        .box {
            margin-bottom: 10px;
            padding-right: 30px;
        }

        .edit-box {
            position: absolute;
            right: 15px;
            top: 15px;
            font-size: 24px;
            color:$primary-color;
        }
    }
}

.reply-box {
    display: none;
}

@media (min-width: 992px) {
    .content-fixed {
        margin-top: 121px;
    }
}

@media (max-width: 992px) {
    .bottom-header {
        .burger-menu-bottom {
            display: inline-block;
            color: #fff;
            padding: 10px 0;
        }

        .hd-menu-list {
            position: fixed;
            width: 300px;
            left: 0;
            top: 0;
            bottom: 0;
            flex-direction: column;
            background: $primary-color-dark;
            align-items: stretch;
            z-index: 999;
            transform: translateX(-200%);
            padding-top: 60px;
            &:before{
                content: attr(data-title);
                z-index: 9999;
                position: absolute;
                top: 12px;
                left: 15px;
                color: $second-color;
                font-size: 24px;
            }
            .menu-link {
                >a {

                    &:hover,
                    &.active {
                        background-color: $primary-color;
                        padding-left: 15px;
                    }

                    &.active {
                        &:before {
                            content: '\f0da';
                            font-family: 'Font Awesome 5 Free';
                            font-weight: bold;
                            margin-right: 15px;
                        }
                    }
                }
            }
        }
    }
}

@include media(768px) {
    .fb-item {
        padding: 15px;
    }

    .fb-summary-container {
        padding: 15px;

        .fb-type {
            flex-basis: 50%;
        }
    }
}

@include media(600px) {
    .fb-item {
        flex-wrap: wrap;

        .fb-info {
            margin-left: 0;
        }
    }

    .fb-summary-container {
        .fb-type {
            flex-basis: 100%;
        }
    }

    .fb-item .fb-info {

        .name-rating {
            flex-wrap: wrap;

            .name {
                margin: 5px 0;
                margin-bottom: 5px;
            }

            .rating-wrap {
                width: 100%;

                .rating {
                    justify-content: flex-end;
                }
            }
        }
    }
}


//New 15/06/2020

#js-book-calendar {
    .fc-timegrid-slot {
        height: 3rem;
    }

    .fc-timegrid-slot-label-frame {
        position: relative;
    }

    .fc-timegrid-slot-label-cushion {
        padding: 0 7px;
        padding-left: 20px;
        color:$primary-color;
        letter-spacing:.3px;
        .hot-icon {
            position: absolute;
            left: 7px;
            color: lighten($primary-color, 20%);
            font-size: 16px;
            top: 50%;
            transform: translateY(-50%);

            &.hotest {
                color: $primary-color;
            }
        }
    }

    .fc-event {
        border-radius: 0;
        padding: 2px;
        bottom: 0;
        position: relative;
        height: 100%;

        &:hover {
            .fix-btn {
                display: inline-block;
            }
        }

        &.booked-slot {
            background-color: rgb(39, 198, 39);
            border-color: rgb(39, 198, 39);
        }

        .fas {
            margin-right: 5px;
        }

        &.empty-slot {
            background-color: transparent;
            border-color: transparent;
        }
        &.fc-event-past {
            background-color: #d8d8d8;
            border-color: #d8d8d8;
            .booking-name{
                color:#777;

            }
            .label-book.booked{
                color: #777;
            }
            &.empty-slot{
                background-color: #d8d8d8;
                border-color: #d8d8d8;
            }
            &.available-slot{
                .inner-content{
                    display:none;
                }
            }
            .fix-btn{
                display:none;
            }
        }

        &.hot-slot{
            &:after {
                content: '\f06d';
                font-family: 'Font Awesome 5 Free';
                font-weight: bold;
                position: absolute;
                left: 35%;
                top: 50%;
                z-index: -1;
                color: lighten($primary-color,20%);
                font-size: 16px;
                transform: translate(-50%, -50%);
            }
            &:before {
                content: 'HOT';
                position: absolute;
                left: 60%;
                top: 50%;
                z-index: -1;
