    /* Customize the label (the container) */
    .lb-contrainer {
        position: relative;
        padding: 5px 10px;
        cursor: pointer;
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
    }

        .lb-contrainer input {
            position: absolute;
            opacity: 0;
            cursor: pointer;
            height: 0;
            width: 0;
        }


    .checkmark {
        position: absolute;
        top: 0;
        left: 0;
        height: 20px;
        width: 20px;
        background-color: #eee;
    }


    .lb-contrainer:hover input ~ .checkmark {
        background-color: #ccc;
    }


    .lb-contrainer input:checked ~ .checkmark {
        background-color: $primary-color;
    }


    .checkmark:after {
        content: "";
        position: absolute;
        display: none;
    }


    .lb-contrainer input:checked ~ .checkmark:after {
        display: block;
    }


    .lb-contrainer .checkmark:after {
        left: 8px;
        top: 5px;
        width: 5px;
        height: 10px;
        border: solid white;
        border-width: 0 3px 3px 0;
        -webkit-transform: rotate(45deg);
