.card-shadow{
    height: 100%;
    position: absolute;
    bottom: 0;
    left: 0;
    right: 0;
    width: 80%;
    margin: 0 auto;

    border-bottom-left-radius:16px;
    border-bottom-right-radius:16px;
    z-index:2;
    transition:box-shadow, transform 500ms ease-in-out 0s;
    &.sub{
        width:70%;
        height:100%;
        transform: translateY(0);
        z-index:1;
        opacity:0.8;
        transition:box-shadow, transform 500ms ease-in-out 0s;
    }
}

.edit-summary-btn{
    position:absolute;
    right:0;
    top:0;
}
.input-float {
    display:flex;
    flex-flow: column-reverse;
    position: relative;
    label,
    input {
        transition: all 0.2s;
        touch-action: manipulation;
    }

    label {
        letter-spacing: 0.05em;
    }

    input:placeholder-shown+label {
        cursor: text;
        max-width: 66.66%;
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
        transform: translate(0, -50%);
    }

    input::-webkit-input-placeholder {
        opacity: 0;
        transition: inherit;
    }

    input:focus::-webkit-input-placeholder {
        opacity: 1;
    }

    input:not(:placeholder-shown)+label,
    input:focus+label {
        transform: translate(0, -50%);
        cursor: pointer;
        top: 0;
        background: #fff;
        padding:0 3px;
    }
    > select + label{
        transform: translate(0, -50%);
        cursor: pointer;
        top: 0;
        background: #fff;
        padding:0 3px;
    }
    >label{
        position:absolute;
        top:50%;
        left:14px;
        margin-bottom:0;
        font-size:12px;
        color:#c3c3c3;
        pointer-events: none;
        user-select: none;

    }
}

.upload-container {
    .upload-avatar{
        display:block;
        position:relative;
        overflow:hidden;
        &:before{
            content:'';
            background:rgba(0,0,0,.4);
            position:absolute;
            left:0;
            top:0;
            width:100%;
            height:100%;
            z-index:1;
            opacity:0;
            transition: opacity .3s linear;
        }
        &:after{
            content:'\f093';
            font-family:'Font Awesome 5 Free';
            font-size:60px;
            color:lighten($primary-color, 30%);
            position:absolute;
            font-weight:bold;
            left:50%;
            top:50%;
            transform:translate(-50%,-50%);
            opacity:0;
            transition: opacity .3s ease-in;
            z-index:2;
        }
        &:hover{
            cursor:pointer;
            &:before, &:after{
                opacity:1;
            }
        }
    }
}

.teacher-avatar{
    .upload-avatar,.upload-container{
        width:inherit;
        height:inherit;
    }
}

